import React, { useEffect, useState } from 'react'
import Home from './pages/Home';

function App() {
  const[posts, setPosts] = useState([]);

  useEffect(() => {
    fetch('/posts').then(
      response => response.json()
    ).then(
      data => {
        setPosts(data);
        console.log(data);
      }
    )
  }, []);

  return (
    <>
      <Home/>
    </>
  )
}

export default App
